                                       when E06 in (1,3) and E08=4 and E14=0 then 2
									   when E06 in (1,3) and E08=12 and E14=0 then 1
                                       when E06 in (1,3) and E08 in (2,3,6,7,8,9,10,11,14,88) and E14=0 then 88
									   else E14 end;

